public class Print5 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
           int no=1;
           int i=1;
           int j=2;
           while (no<=10)
           {
        	   if(i<=9)
        	   {
        		   System.out.print(i+" ");
            	   i=i+2;  
        	   }
        	   else if(j<=10)
        	   {
        		   System.out.print(j+" ");
              	 j=j+2;
        	   }
           }
	}
}
